Condition : 36 - 36. Prior to the commencement of the works of site clearance, demolition of existing buildings and structures, ground investigation and site survey works, erection of temporary boundary fencing or hoarding, archaeological investigation and works of decontamination and remediation taking place a Construction and Environmental Management Plan for this element of the work shall be submitted to and approved by the Local Planning Authority.  This element of the work shall not be undertaken otherwise than in accordance with that Construction and Environment Management Plan approved in writing by the local planning authority. Following completion of this element of work no further development shall commence on site until a further Construction and Environmental Management Plan for the other element of the work has been submitted to and been approved by the Local Planning Authority.  The Construction and Environmental Management Plan shall then be reviewed and updated prior to commencement of each Plot, to take particular account of the development proposed in the relevant plot and any new residents elsewhere within the development, and an amended version submitted to the Local Planning Authority for approval prior to commencement of development of that Plot unless it is agreed in writing by the Local Planning Authority that no amended version is warranted.  The Construction Management Plan shall include specific details for:-
a) the control of noise and vibration during hours of noisy activities; 
b) a waste and material management, transportation and disposal strategy, including delivery booking and vehicle holding arrangements, and targets and arrangements for maximising the use of the river for 'muck away' and material delivery where feasible;
c) air quality measures for the control and monitoring of dust, fine particles and odours;
d)construction traffic routing through the area and the development site and an enforcement system for breach of its provisions;
